import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import CustomWorlds from '../components/CustomWorlds';

const CustomWorldsPage = () => {
  return (
    <>
      <Header />
      <CustomWorlds />
      <Footer />
    </>
  );
};

export default CustomWorldsPage;
